import React from "react";
import todosData from "../../data/toDoData";
import TodoItem from "./todoItem";
{
  /* <TodoItem
attributes={{
  question: "What's up?",
  answer: "Your mom"
}}
></TodoItem>
<TodoItem
attributes={{
  question: "What's the matter?",
  answer: "Existential frustration"
}}
></TodoItem>
<TodoItem
attributes={{
  question: "When's dinner?",
  answer: ""
}}
></TodoItem> */
}
class ToDoCard extends React.Component {
  constructor() {
    super();
  }
  render() {
    return (
      <div>
        {todosData.map((item, i) => {
          <TodoItem key={i} attributes={item}></TodoItem>;
        })}
      </div>
    );
  }
}
export default ToDoCard;
